import React from 'react';
import {Input} from './write';

const Write = () => {
    return (
        <>
            <form id="twit-form" action="/post" method="post" encType="multipart/form-data">
                <div>
                    <input type="text" id="file_route" disabled="disabled" value="파일 선택" />
                    <label htmlFor="upload_file" style="border: solid 1px black;">업로드</label>
                    <input type="file" id="upload_file" accept="image/*" required
                           style="position:absolute; clip:rect(0, 0, 0, 0);" />
                    <Input id="img" type="file" accept="image/*" required />
                    <button for="img" id="twit-btn" type="submit" className="btn">업로드</button>
                </div>
                <div className="input-group">
                    <textarea id="twit" name="content" maxLength="140"></textarea>
                </div>
            </form>
        </>
    );
};

export default Write;
